(2, 2, 2, 2, 3, 'Una vez en tierras lejanas, un joven fue al bosque y le dijo a su guía espiritual:\n	"Quisiera tener riqueza sin límites y con esa riqueza ayudar y sanar al mundo. Por favor, ¿me dirás el secreto para crear esa abundancia?"\n	Y el maestro respondió:\n	"Hay dos diosas que habitan en el corazón de cada ser humano, y todos amamos profundamente a esos seres divinos. Son las diosas del Conocimiento y de la Abundancia. Pero existe un secreto que debes de saber, y yo te lo diré:\n	Aunque ames a ambas diosas, debes prestar más atención a una de ellas. Es la diosa del Conocimiento, y se llama Sarasvati. Persíguela, ámala y préstale atención.\n	La otra se llama Lakshmi, y es la diosa de la abundancia, al ver que le prestas más atención a Sarasvati, Lakshmi se pondrá muy celosa y se fijará más en ti.\n	Cuanto más persigas a la diosa del conocimiento, la de la abundancia te perseguirá más a ti. Te seguirá donde quiera que vayas, nunca te abandonará y tendrás para siempre esa riqueza que deseas."\n\n', , 'IMG_6142.jpg', 'jpg');
